(window.webpackJsonp=window.webpackJsonp||[]).push([[5],{NdhD:function(e){e.exports=JSON.parse('[{"title":"\u8a8d\u8b58\u6211\u5011","html":["<p>\u5ea7\u843d\u5728\u6cb3\u6ff1\u5e02(City of Riverside) \u7684\u6069\u806f\u6559\u6703\uff0c\u7de3\u8d77\u65bc\u9577\u5e74\u53c3\u52a0\u6771\u5b89\u53f0\u798f\u57fa\u7763\u6559\u6703\u805a\u6703\u7684\u4e00\u5c0f\u7fa4\u5144\u59ca\uff0c\u56e0\u53d7\u8056\u9748\u611f\u52d5\uff0c","\u5728\u5148\u9a45\u7267\u8005\u5e36\u9818\u4e0b\uff0c\u65bc1988\u5e744\u6708\u958b\u59cb\u4e86\u6bcf\u6708\u4e00\u6b21\u7684\u5bb6\u5ead\u805a\u6703\u3002\u5176\u5f8c\u65bc1990\u5e74\u8f49\u800c\u79df\u7528Ruth Lewis Community Center\uff0c","\u6bcf\u5468\u516d\u8209\u884c\u67e5\u7d93\u805a\u6703\u3002\u4e8c\u5e74\u4e4b\u5f8c\uff0c\u670917\u4f4d\u5144\u59ca\u59d4\u8eab\uff0c\u7531\u6771\u5b89\u6bcd\u6703\u5dee\u6d3e\u5206\u8a2d\u6559\u6703\uff0c1992\u5e742\u67089\u65e5\u8209\u884c\u4e86\u8a2d\u6559\u79ae\u62dc\uff0c\u6069\u806f\u53f0\u798f\u57fa\u7763\u6559\u6703\u6b63\u5f0f\u6210\u7acb\u3002","Riverside\u5730\u8655\u5927\u6d1b\u6749\u78ef\u7684\u6771\u7de3\uff0c\u83ef\u4eba\u5206\u5c45\u6563\u843d\uff0c\u4eba\u53e3\u65e5\u6f38\u589e\u591a\uff0c\u6559\u6703\u6210\u54e1\u5206\u4f4f\u65bcRiverside\u3001Moreno Valley\u3001Loma Linda\u3001Redlands\u3001","Highland \u3001Corona \u7b49\u9130\u8fd1\u57ce\u5e02\uff0c\u5404\u5340\u5206\u8a2d\u5c0f\u7d44\uff0c\u805a\u6703\u65bc\u6bcf\u5468\u4e8c\u3001\u5468\u4e94\u3001\u5468\u516d\u3001\u4ee5\u53ca\u5468\u65e5\u3002\u76ee\u524d\u4eba\u6578\u7d0460~70\u4eba\uff0c\u5c6c\u5c0f\u578b\u6559\u6703\uff0c","\u5f7c\u6b64\u4e4b\u9593\u5bb9\u6613\u8a8d\u8b58\u719f\u6089\uff0c\u5927\u5925\u5152\u95dc\u4fc2\u89aa\u5bc6\u3001\u4e92\u52d5\u6027\u9ad8\uff0c\u662f\u6069\u806f\u7684\u4e00\u5927\u7279\u8272\u3002","<p>\u6069\u806f\u6559\u6703\u6210\u7acb\u8fc4\u4eca\u5df2\u670927\u5e74\u9918\uff0c\u611f\u8b1d\u4e0a\u5e1d\u7279\u5225\u7684\u6069\u5178\uff0c1994\u5e74\u5728\u5168\u9ad4\u6703\u53cb\u7684\u79b1\u544a\uff0c\u4e26\u4e14\u5728\u7e3d\u6703\u53ca\u6bcd\u6703\u4e0d\u907a\u9918\u529b\u7684\u9f0e\u529b\u76f8\u52a9\u4e0b\uff0c","\u8b93\u6069\u806f\u6559\u6703\u7279\u5225\u8499\u6069\uff0c\u8a2d\u6559\u4e0d\u4e45\u5c31\u64c1\u6709\u4e86\u73fe\u5728\u7684\u6703\u5802\u3002\u6559\u6703\u8fd1\u5e74\u4f86\u96d6\u6210\u9577\u7de9\u6162\uff0c\u4f46\u6703\u52d9\u4ecd\u76f8\u7576\u7a69\u5b9a\uff0c\u9019\u671f\u9593\u6709\u6578\u6b21\u7267\u5e2b\u4efb\u671f\u5c46\u6eff\u96e2\u8077\uff0c","\u540c\u5de5\u5747\u80fd\u627f\u64d4\u91cd\u4efb\uff0c\u4e26\u4e14\u5e78\u6709\u7e3d\u6703\u7267\u8005\u3001\u795e\u5b78\u9662\u6559\u6388\u3001\u53ca\u5404\u65b9\u7684\u63a8\u85a6\u5354\u52a9\uff0c\u4f7f\u6559\u6703\u80fd\u5920\u9762\u5c0d\u8655\u7406\u5404\u7a2e\u56f0\u96e3\uff0c\u6bcf\u9031\u7684\u4e3b\u65e5\u8b1b\u53f0\u4f9b\u61c9\u4fe1\u606f\u4e0d\u66fe\u77ed\u7f3a\uff0c","\u5be6\u5728\u611f\u8b1d\u4e3b\u6069\uff01","<p>UCR\u8fd1\u5728\u54ab\u5c3a\uff0c\u5411\u5b78\u751f\u50b3\u798f\u97f3\u4e00\u76f4\u662f\u6559\u6703\u7684\u7570\u8c61\u8207\u8ca0\u64d4\uff0c\u76f4\u52302004\u5e74\u8a31\u660e\u9060\u7267\u5e2b\u767c\u8d77\u5230UCR\u6821\u5712\u767c\u55ae\u5f35\uff0c\u6bcf\u9031\u4e94\u8fa6\u7406\u5b78\u751f\u5718\u5951\uff0c\u5b89\u6392\u514d\u8cbb\u82f1\u8a9e\u6559\u5b78\uff0c","\u4f9b\u61c9\u665a\u9910\uff0c\u5b78\u751f\u4e8b\u5de5\u56e0\u4e4b\u843d\u5be6\uff0c\u9019\u4e9b\u512a\u79c0\u7684\u5b78\u751f\uff0c\u4e0d\u8ad6\u5728\u5927\u5b78\u6216\u662f\u5728\u78a9\u3001\u535a\u58eb\u7814\u7a76\u6240\uff0c\u90fd\u80fd\u85c9\u7531\u67e5\u8003\u8056\u7d93\u660e\u767d\u4fe1\u4ef0\u771f\u610f\uff0c\u5f7c\u6b64\u66f4\u56e0\u5718\u5951\u751f\u6d3b\uff0c","\u76f8\u8655\u5982\u5bb6\u4eba\uff0c\u514d\u9664\u5b64\u55ae\u96e2\u9109\u4e4b\u82e6\u3002\u6559\u6703\u9664\u4f9d\u5730\u5340\u3001\u5e74\u9f61\u5b89\u6392\u5404\u67e5\u7d93\u5c0f\u7d44\u5916\uff0c\u9031\u4e8c\u65e9\u4e0a\u6eab\u67d4\u5c0f\u7d44\u662f\u7279\u5225\u70ba\u5e74\u8f15\u5abd\u5abd\u6240\u8a2d\u8a08\u7684\u6d3b\u52d5\u3002","\u80e1\u6167\u73b2\u7267\u5e2b\u6bcf\u6708\u4e8c\u6b21\u8209\u884c\u8b1b\u5ea7\uff0c\u89aa\u5b50\u95dc\u4fc2\u3001\u5a5a\u59fb\u95dc\u4fc2\u3001\u60c5\u7dd2\u7ba1\u7406\u7b49\u7686\u70ba\u4e3b\u984c\u3002\u76ee\u524d\u4ea6\u898f\u5283\u8b80\u66f8\u6703\uff0c\u5c0d\u793e\u5340\u7684\u5abd\u5abd\u5011\u63d0\u4f9b\u5b78\u7fd2\u53ca\u4e92\u76f8\u5207\u78cb\u7684\u6a5f\u6703\u3002","\u9019\u4e8c\u9805\u662f\u6559\u6703\u7684\u798f\u97f3\u5916\u5c55\u4e8b\u5de5\uff0c\u611f\u8b1d\u4e3b\u539a\u5f85\u5f15\u9818\uff0c\u73fe\u4eca\u6642\u6709\u5b78\u751f\u9752\u5e74\uff0c\u5e74\u8f15\u7684\u5bb6\u5ead\u9678\u7e8c\u4f86\u5230\u6559\u6703\uff0c\u4e26\u4e14\u53c3\u8207\u670d\u4e8b\uff0c\u5be6\u70ba\u8fd1\u5e74\u4f86\u6559\u6703\u8499\u4e3b\u6069\u6700\u5927\u7684\u795d\u798f\uff01","<p>\u6559\u6703\u56e0\u8ca1\u52d9\u9700\u8981\uff0c\u81ea\u8cfc\u5802\u8d77\u5c31\u79df\u65bcCornerstone Fellowship Bible Church \uff0c\u76f4\u81f32014\u5e746\u6708\u65b9\u624d\u505c\u79df\u3002","\u4f46\u65bc\u540c\u5e747\u6708\u5373\u6709Bridges Bible Church \u79df\u7528\u81f3\u4eca\u3002\u4e3b\u65e5\u4e0b\u5348\u6709\u58a8\u897f\u54e5\u6559\u6703\u79df\u7528\uff0c\u6bcf\u9031\u4e09\u6709Verita\u4f5cHome School \u7684\u5834\u6240\uff0c","2019\u5e742\u6708\u8d77Toast masters Bilingual Club \u4e5f\u5728\u4e3b\u65e5\u4e0b\u5348\u79df\u501f\u4e00\u9593\u6559\u5ba4\u4f7f\u7528\uff0c\u4e0d\u540c\u7684\u55ae\u4f4d\u5171\u540c\u4f7f\u7528\u6559\u6703\u7684\u786c\u9ad4\u8a2d\u65bd\uff0c\u5f7c\u6b64\u5b78\u7fd2\uff0c\u4e92\u76f8\u5e6b\u88dc\uff0c","2018\u5e74\u5df2\u511f\u6e05\u8cfc\u5802\u6240\u6709\u8cb8\u6b3e\uff0c\u662f\u4e3b\u83ab\u5927\u7684\u6069\u5178\uff01","<p>\u53e6\u5916\uff0c\u5341\u591a\u5e74\u4f86UCR\u65e5\u6f38\u64f4\u5927\uff0c\u5b78\u751f\u8cfc\u7269\u6d3b\u52d5\u4e2d\u5fc3\u8207\u5b78\u751f\u516c\u5bd3\u90fd\u5728\u6559\u6703\u9130\u8fd1\u5efa\u7acb\uff0c\u4f7f\u539f\u672c\u8352\u856a\u7684\u5730\u5340\u84cb\u6eff\u5efa\u7bc9\u7269\u3002","\u52a0\u4e0a60\u53ca215\u9ad8\u901f\u516c\u8def\u7684\u62d3\u5bec\u5de5\u7a0b\u5b8c\u6210\uff0c\u6559\u6703\u5916\u570d\u7684\u5927\u74b0\u5883\u5b8c\u5168\u6539\u89c0\uff0c\u7f8e\u5316\u4fbf\u6377\uff0c\u662f\u7576\u521d\u8cfc\u5802\u6642\u59cb\u6599\u672a\u53ca\u7684\uff0c","\u4e0a\u5e1d\u90a3\u4e0d\u80fd\u6e2c\u5ea6\u7684\u8c50\u5bcc\u8207\u5927\u80fd\u662f\u6211\u5011\u980c\u8b9a\u4e0d\u76e1\u7684\u3002\u9858\u4e3b\u6069\u60e0\u62ab\u6fa4\uff0c\u4e3b\u5149\u6c38\u7167\u6069\u806f\u3002"]},{"title":"About us","html":["<p>EFCIE Located in City of Riverside...."]}]')}}]);